// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/Strings.sol";

import "./TokenMetaData.sol";

contract BallSonic is ERC721URIStorage, Ownable {
    using Strings for uint256;
    uint256 public tokenCount;
    uint256 nonce;
    string public baseURI;

    struct Attribute {
        string mintType;
        uint256 category;
        uint256 currentPowerLvl;
        uint256 currentAccuracyLvl;
        uint256 currentSpinLvl;
        uint256 currentTimeLvl;
        uint256 maxPowerLvl;
        uint256 maxAccuracyLvl;
        uint256 maxSpinLvl;
        uint256 maxTimeLvl;
    }

    string public imageBaseURI;

    string public mintType;
    mapping(uint256 => uint256) public category;
    mapping(uint256 => uint256) public currentPowerLvl;
    mapping(uint256 => uint256) public currentAccuracyLvl;
    mapping(uint256 => uint256) public currentSpinLvl;
    mapping(uint256 => uint256) public currentTimeLvl;
    mapping(uint256 => uint256) public maxPowerLvl;
    mapping(uint256 => uint256) public maxAccuracyLvl;
    mapping(uint256 => uint256) public maxSpinLvl;
    mapping(uint256 => uint256) public maxTimeLvl;

    // using TokenMetadata for string;

    TokenMetadata.Attribute attribute;

    mapping(address => uint256[]) public userTokenIds;
    mapping(uint256 => bool) blackList;
    mapping(uint256 => uint256) public tokenIdType;

    constructor() ERC721("BallSonic", "BAS") {
        tokenCount = 1000;
        mintType = "BallSonic";
    }

    function mint() external payable {
        require(tokenCount > 0);
        require(msg.value >= 1 * 10**18);
        uint256 rand = uint256(
            keccak256(abi.encodePacked(block.timestamp, msg.sender, nonce))
        ) % tokenCount;
        nonce++;
        uint256 index = 0;
        uint256 _tokenId = 0;
        for (uint256 i = 0; i < 1000; i++) {
            if (blackList[i] == false) {
                if (index == rand) {
                    _tokenId = i + 1;
                    blackList[_tokenId] = true;
                    tokenCount--;
                    break;
                }
                index++;
            }
        }
        userTokenIds[msg.sender].push(_tokenId);
        _safeMint(msg.sender, _tokenId);
        if (_tokenId >= 1 && _tokenId <= 500) tokenIdType[_tokenId] = 1;
        if (_tokenId >= 501 && _tokenId <= 700) tokenIdType[_tokenId] = 2;
        if (_tokenId >= 701 && _tokenId <= 850) tokenIdType[_tokenId] = 3;
        if (_tokenId >= 851 && _tokenId <= 950) tokenIdType[_tokenId] = 4;
        if (_tokenId >= 951 && _tokenId <= 1000) tokenIdType[_tokenId] = 5;
        category[_tokenId] = tokenIdType[_tokenId];
        currentPowerLvl[_tokenId] = 1;
        currentAccuracyLvl[_tokenId] = 1;
        currentSpinLvl[_tokenId] = 1;
        currentTimeLvl[_tokenId] = 1;
        maxPowerLvl[_tokenId] = 5;
        maxAccuracyLvl[_tokenId] = 5;
        maxSpinLvl[_tokenId] = 5;
        maxTimeLvl[_tokenId] = 5;
        setTokenURI(_tokenId);
    }

    function upgrade(
        uint256 _tokenId,
        uint256 _upgradePowerLvl,
        uint256 _upgradeAccuracyLvl,
        uint256 _upgradeSpinLvl,
        uint256 _upgradeTimeLvl
    ) external {
        require(msg.sender == ERC721.ownerOf(_tokenId));
        currentPowerLvl[_tokenId] = _upgradePowerLvl;
        currentAccuracyLvl[_tokenId] = _upgradeAccuracyLvl;
        currentSpinLvl[_tokenId] = _upgradeSpinLvl;
        currentTimeLvl[_tokenId] = _upgradeTimeLvl;
        setTokenURI(_tokenId);
    }

    function setTokenURI(uint256 _tokenId) internal {
        attribute = TokenMetadata.Attribute(
            "BallSonic",
            category[_tokenId],
            currentPowerLvl[_tokenId],
            currentAccuracyLvl[_tokenId],
            currentSpinLvl[_tokenId],
            currentTimeLvl[_tokenId],
            maxPowerLvl[_tokenId],
            maxAccuracyLvl[_tokenId],
            maxSpinLvl[_tokenId],
            maxTimeLvl[_tokenId]
        );
        string memory imageURI = string(abi.encodePacked(imageBaseURI,tokenIdType[_tokenId].toString()));
        string memory json = TokenMetadata.makeMetadataJSON(
            _tokenId,
            ERC721.ownerOf(_tokenId),
            "8Ball",
            imageURI,
            "8Ball is fantastic game",
            attribute
        );
        string memory tokenURI = TokenMetadata.toBase64(json);
        _setTokenURI(_tokenId, tokenURI);
    }
    
    function setImageBaseUri(string memory _imageBaseURI) external onlyOwner {
        imageBaseURI = _imageBaseURI;
    }

    function burn(uint256 _tokenId) external {
        require(
            msg.sender == ERC721.ownerOf(_tokenId),
            "Only the owner of NFT can transfer or bunt it"
        );
        _burn(_tokenId);
    }

    function transfer(
        address _from,
        address _to,
        uint256 _tokenId
    ) external {
        require(
            msg.sender == _from,
            "Only the owner of NFT can transfer or bunt it"
        );
        _transfer(_from, _to, _tokenId);
    }

    function ownerWithdraw() external onlyOwner {
        address ownerAddress = msg.sender;
        (bool isSuccess, ) = ownerAddress.call{value: (address(this).balance)}(
            ""
        );
        require(isSuccess, "Withdraw fail");
    }
}

contracts/TokenMetaData.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/utils/StringsUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/Base64Upgradeable.sol";

library TokenMetadata {
    using StringsUpgradeable for uint256;
    using StringsUpgradeable for address;
    using Base64Upgradeable for bytes;
    using TokenMetadata for Attribute;

    struct Attribute {
        string mintType;
        uint256 category;
        uint256 currentPowerLvl;
        uint256 currentAccuracyLvl;
        uint256 currentSpinLvl;
        uint256 currentTimeLvl;
        uint256 maxPowerLvl;
        uint256 maxAccuracyLvl;
        uint256 maxSpinLvl;
        uint256 maxTimeLvl;
    }

    function toBase64(string memory json)
        internal
        pure
        returns (string memory)
    {
        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    bytes(json).encode()
                )
            );
    }

    function makeMetadataJSON(
        uint256 tokenId,
        address owner,
        string memory name,
        string memory imageURI,
        string memory description,
        Attribute memory attribute
    ) internal pure returns (string memory) {
        string memory metadataJSON = makeMetadataString(
            tokenId,
            owner,
            name,
            imageURI,
            description
        );
        return
            string(
                abi.encodePacked(
                    "{",
                    metadataJSON,
                    attribute.toJSONString(),
                    "}"
                )
            );
    }

    function makeMetadataString(
        uint256 tokenId,
        address owner,
        string memory name,
        string memory imageURI,
        string memory description
    ) internal pure returns (string memory) {
        return
            string(
                abi.encodePacked(
                    '"name":"',name,'",',
                    '"tokenId":"',tokenId.toString(),'",',
                    '"description":"',description,'",',
                    '"image":"',imageURI,'",',
                    '"owner":"',owner.toHexString(),'",'
                )
            );
    }

    function toJSONString(Attribute memory attribute)
        internal
        pure
        returns (string memory)
    {
        string memory attributeString = "";
        string memory newAttributeString = string(
                abi.encodePacked(
                    attributeString,
                    '{"mintType":"',attribute.mintType,'",',
                    '"category":"',attribute.category.toString(),'",',
                    '"currentPowerLvl":"',attribute.currentPowerLvl.toString(),'",',
                    '"currentAccuracyLvl":"',attribute.currentAccuracyLvl.toString(),'",',
                    '"currentSpinLvl":"',attribute.currentSpinLvl.toString(),'",',
                    '"currentTimeLvl":"',attribute.currentTimeLvl.toString(),'",',
                    '"maxPowerLvl":"',attribute.maxPowerLvl.toString(),'",',
                    '"maxAccuracyLvl":"',attribute.maxAccuracyLvl.toString(),'",',
                    '"maxSpinLvl":"',attribute.maxSpinLvl.toString(),'",',
                    '"maxTimeLvl":',attribute.maxTimeLvl.toString(),"}"
                )
            );
            attributeString = newAttributeString;
        return string(abi.encodePacked('"attributes":', attributeString));
    }

    function makeContractURI(
        string memory name,
        string memory description,
        string memory imageURL,
        string memory externalLinkURL,
        uint256 sellerFeeBasisPoints,
        address feeRecipient
    ) internal pure returns (string memory) {
        return
            string(
                abi.encodePacked(
                    '{"name":"',
                    name,
                    '",',
                    '"description":"',
                    description,
                    '",',
                    '"image":"',
                    imageURL,
                    '",',
                    '"external_link":"',
                    externalLinkURL,
                    '",',
                    '"seller_fee_basis_points":',
                    sellerFeeBasisPoints.toString(),
                    ",",
                    '"fee_recipient":"',
                    feeRecipient.toHexString(),
                    '"}'
                )
            );
    }
}

